INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (0.0, 0.0, 24015, 0.0, "2019/07/31 12:00:00", 4, 1, 110501, 4, 24, 10021, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", "カオリ（サマー）", "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (0.0, 4.0, 24016, 0.0, "2019/07/31 12:00:00", 4, 2, 110501, 1, 24, 10021, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", "カオリ（サマー）", "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (0.0, 0.0, 24017, 0.0, "2019/07/31 12:00:00", 4, 3, 110501, 4, 24, 10021, "マジムンだらけで目が回るさ～！\nふらふらさ～！", "カオリ（サマー）", "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (0.0, 5.2, 24018, 0.0, "2019/07/31 12:00:00", 1, 4, 110501, 2, 24, 10021, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", "カオリ（サマー）", "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (0.0, 4.2, 24019, 0.0, "2019/07/31 12:00:00", 5, 5, 110501, 6, 24, 10021, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", "カオリ（サマー）", "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (0.0, 0.0, 24020, 0.0, "2019/07/31 12:00:00", 2, 6, 110501, 2, 24, 10021, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", "カオリ（サマー）", "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (0.0, 6.4, 24021, 0.0, "2019/07/31 12:00:00", 1, 7, 110501, 6, 24, 10021, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", "カオリ（サマー）", "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (0.0, 0.0, 24022, 0.0, "2019/07/31 12:00:00", 2, 8, 110501, 2, 24, 10021, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", "カオリ（サマー）", "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (0.0, 10.08, 24023, 0.0, "2019/07/31 12:00:00", 6, 9, 110501, 3, 24, 10021, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", "カオリ（サマー）", "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (0.0, 5.0, 24024, 0.0, "2019/07/31 12:00:00", 1, 10, 110501, 2, 24, 10021, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", "カオリ（サマー）", "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (0.0, 0.0, 24025, 0.0, "2019/07/31 12:00:00", 2, 11, 110501, 2, 24, 10021, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", "カオリ（サマー）", "2030/12/17 14:59:59");
